import React from 'react';

const Hashtag = () => {
    return <div>Hashtag</div>;
};

Hashtag.getInitialProps = async (context) => {
    // 서버에서도 프론트에서도 실행됨 젤 먼저 실행됨.
    console.log('hashtag getInitialProps', context.query.tag);
};

export default Hashtag;
